import React from 'react';

const Page3 = ({ story, quote }) => {
  return (
    <div className="page">
      <h1>Quotify</h1>
      <p>Write down your story!</p>
      <input type="text" value={story} readOnly />
      <div className="quote-box">
        <p>"{quote}"</p>
        <p>- Mahatma Gandhi</p>
      </div>
    </div>
  );
};

export default Page3;
